import "./Expense.css";
import ExpenseItem from "./components/ExpenseItem";

function Expense(props) { 

    const expences = props.expences;
    return (
        <div className="expense">
          <h2>Let's get started!</h2>
          <ExpenseItem title={expences[0].title} price={expences[0].price} date={expences[0].date}></ExpenseItem>
          <ExpenseItem title={expences[1].title} price={expences[1].price} date={expences[1].date}></ExpenseItem>
          <ExpenseItem title={expences[2].title} price={expences[2].price} date={expences[2].date}></ExpenseItem>
          <ExpenseItem title={expences[3].title} price={expences[3].price} date={expences[3].date}></ExpenseItem>
        </div>
      );

}


export default Expense;
